function Top() {
    let css = {
        top : {
            width: '100%',
            height: '70px',
            backgroundColor: 'grey',

        },
        ul : {
            listStyleType: 'none',
            width: '500px',
        }
    }

    return (
        <div style={css.top}>
            <ul style={css.ul}>
                <li>Home</li>
                <li>About</li>
                <li>Services</li>
                <li>Blog</li>
                <li>Contact</li>
                <li></li>
            </ul>


        </div>
    );
}

export default Top;
